import { NavLink } from "react-router-dom";
import {FaShoppingCart } from "react-icons/fa";
const Navbar = () => {
  return (
    <div >
      <nav className="max-w-[1080px] flex justify-between mx-auto">
        <div>
          <img src="public\shop-logo.jpg" alt="logo"/>
        </div>
        <div className="flex gap-2">
          <NavLink to="/">
            <div>Home</div>
          </NavLink>

          <NavLink to="/cart">
            <FaShoppingCart/>
          </NavLink>

        </div>
      </nav>
    </div>
  )
};

export default Navbar;
